/**********************************************************************************************************************
 * Function Name: draw_with_alpha
 * Description  : .
 * Arguments    : object
 *              : hoffset
 *              : voffset
 * Return Value : .
 *********************************************************************************************************************/
static void draw_with_alpha (st_gimp_fg_font_22_image_t * object, uint16_t hoffset, uint16_t voffset)
{
    display_input_cfg_t const * p_input = &g_display0.p_cfg->input[0]; // Layer 2

    uint8_t * buf_ptr = (uint8_t *) fb_background;

    buf_ptr += (hoffset * (p_input->hstride * 4));                     // Horizontal offset
    buf_ptr += (voffset * 4);                                          // Vertical offset

    uint32_t bpp = object->bytes_per_pixel;

    /* Convert format */
    memset(buf_ptr, 0, p_input->hstride * p_input->vsize * 2);
    for (uint32_t v = 0; v < object->height; v++)
    {
        uint32_t v_offset = v * object->width * bpp;

        for (uint32_t h = 0; h < (object->width * bpp); h += bpp)
        {
            buf_ptr[0] = object->pixel_data[v_offset + h + 0]; //
            buf_ptr[1] = object->pixel_data[v_offset + h + 1]; //
            buf_ptr   += 2;
        }

        buf_ptr += ((p_input->hstride - p_input->hsize) * 2);
    }
}

/**********************************************************************************************************************
 * End of function draw_with_alpha
 *********************************************************************************************************************/

/**********************************************************************************************************************
 * Function Name: print_bg_font_18_direct
 * Description  : .
 * Arguments    : _xs
 *              : _ys
 *              : _str
 * Return Value : .
 *********************************************************************************************************************/
void print_bg_font_18_direct (d2_point _xs, d2_point _ys, char * _str)
{
    st_gimp_bg_font_18_image_t * img = NULL;
    uint16_t cur_x = _xs;
    uint16_t cur_y = _ys;
    size_t   len   = strlen(_str);

    for (uint32_t pos = 0; pos < len; pos++)
    {
        myc = (char) *(_str + pos);

        if (pos < 56)                  // Crop to 56 characters ONLY
        {
            if ((uint8_t) myc < 127)
            {
                img = (st_gimp_fg_font_22_image_t *) &ascii_table[myc];

                if (img != NULL)
                {
                    draw_with_alpha(img, cur_x, cur_y);
                    cur_x += (uint16_t) img->height;
                }
            }
        }
    }
}

/**********************************************************************************************************************
 * End of function print_bg_font_18_direct
 *********************************************************************************************************************/
;

/**********************************************************************************************************************
 * Function Name: print_bg_font_18
 * Description  : .
 * Arguments    : handle
 *              : _xs
 *              : _ys
 *              : _str
 * Return Value : .
 *********************************************************************************************************************/
void print_bg_font_18 (d2_device * handle, d2_point _xs, d2_point _ys, char * _str)
{
    st_gimp_bg_font_18_image_t * img = NULL;
    d2_point cur_x = _xs;
    d2_point cur_y = _ys;
    size_t   len   = strlen(_str);

    for (uint32_t pos = 0; pos < len; pos++)
    {
        myc = (char) *(_str + pos);

        if ((uint8_t) myc < 127)
        {
            img = (st_gimp_bg_font_18_image_t *) &ascii_table[myc];

            if (img != NULL)
            {
                d2_setblitsrc(handle,
                              img->pixel_data,
                              (d2_s32) img->width,
                              (d2_s32) img->width,
                              (d2_s32) img->height,
                              d2_mode_rgb565);

                d2_blitcopy(handle,
                            (d2_width) img->width,
                            (d2_width) img->height,          // Source width/height
                            (d2_blitpos) 0,
                            0,                               // Source position
                            (d2_width) ((img->width) << 4),
                            (d2_width) ((img->height) << 4), // Destination width/height
                            (cur_x << 4),
                            (cur_y << 4),                    // Destination position
                            d2_tm_filter);

                cur_y += (d2_point) img->height;
            }
        }
    }
}

/**********************************************************************************************************************
 * End of function print_bg_font_18
 *********************************************************************************************************************/
